script: |
  super -f text -I q4266.spq | sort > q4266.out

inputs:
  - name: q4266.spq
    data: |
      SELECT DISTINCT - 20 + - col1 col0 FROM tab2 (FORMAT parquet) WHERE NOT ( NOT + 78 * 72 - + col2 * col2 <= CAST ( col2 AS REAL ) + col1 );
  - name: tab2

outputs:
  - name: q4266.out
    data: |
